import UsersTable from "../components/admin-components/tables/UsersTable";
import UserForm from "../components/admin-components/forms/User/UserForm";

const DashboardRoutes = () => {
  return [
    {
      path: "/users",
      link: "/users",
      // icon: TeamOutlined,
      menuName: "Tabela sa Korisnicima",
      component: UsersTable,
    },
    {
      path: "/user",
      link: "/user",
      // icon: "icon",
      menuName: "Dodaj novog korisnika",
      component: UserForm,
    },
  ];
};

export default DashboardRoutes();
